import React, { useEffect, useState } from "react";
import { View, Text } from "react-native";
const axios = require("axios");

import Screen from "./app/components/Screen";
import SearchBar from "./app/components/SearchBar";
import FeaturedNews from "./app/components/FeaturedNews";
import SmallCard from "./app/components/smallCard";
import ChickenRecipe from "./app/components/ChickenRecipe";
export default function App() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  useEffect(() => {
    axios
      .get(
        `https://api.edamam.com/search?app_id=900da95e&app_key=40698503668e0bb3897581f4766d77f9&from=0&to=10&&q=chicken`
      )
      .then(({ data: { hits } }) => {
        return hits.map(({ recipe }) => ({
          id: recipe.uri,
          image: recipe.image,
          title: recipe.label,
          deitLabel: recipe.dietLabels,
          mealType: recipe.mealType,
          // digest: recipe.digest,
        }));
      })
      .then((recipe) => {
        setLoading(false);
        setData(recipe);
      })
      .catch((error) => console.log("failed get data", { error }));
  }, []);
  return (
    <Screen>
      <SearchBar />
      <FeaturedNews />
      {/* <SmallCard /> */}
      <ChickenRecipe data={data} />
    </Screen>
  );
  // <View>{loading ? <Text>Loding</Text> : console.log(data)}</View>;
}
